import { UserService } from './services/user.service';
import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.scss'],
})
export class RegisterComponent implements OnInit {
  constructor(private userService: UserService) {}
  ngOnInit(): void {
    this.userService.getUsers$.subscribe((x) => {
      console.log(x);
    });
  }
}
<div class="flex h-screen">
  <div class="w-3/4 p-12 bg-slate-50 ">
    <div class="px-16 h-full  register-bg">
      <h1 class="text-4xl text-blue-900 ">Welcome to <span class="fw-bold text-5xl">Matcher</span> </h1>
      <h5 class="text-blue-600 py-4 ">Login for a beautiful life !</h5>
      <h5 class="text-black ">Let's connect</h5>

    </div>
  </div>
  <div class="w-2/5 p-16">
    <h5 class="text-blue-600 ">Register</h5>
    <div class="my-4 px-5">
      <h1 class="text-left">Username</h1>
      <div class="bg-white">
      </div>
    </div>
  </div>
</div>
